// src/pages/Facilite.js
import React from 'react';

function Facilité() {
  return (
    <div className="bg-white p-6 rounded-lg shadow">
      <h1 className="text-2xl font-bold text-green-700 mb-4">Module Facilité</h1>
      <p className="text-gray-700">
        Bienvenue dans le module <strong>Facilité</strong>. Vous pourrez y gérer les aides, les appuis techniques ou financiers liés aux projets.
      </p>
    </div>
  );
}

export default Facilité;
